// src/pages/ChemistUpload.js
import React, {useState} from "react";
import { uploadBill } from "../services/api";

export default function ChemistUpload(){
  const [file, setFile] = useState(null);
  const [msg, setMsg] = useState("");

  async function onUpload(){
    if(!file){ setMsg("Select a file"); return; }
    const res = await uploadBill(file, "C001");
    setMsg(JSON.stringify(res));
  }

  return (
    <div style={{padding:20}}>
      <h2>Chemist: Upload Bill (CSV/XLSX)</h2>
      <input type="file" accept=".csv,.xlsx" onChange={e=>setFile(e.target.files[0])} />
      <button onClick={onUpload}>Upload</button>
      <pre>{msg}</pre>
    </div>
  );
}
